  //============================================================
  /// A generic base class for Gaussian quadrature of any order.
  //============================================================
  class VariableQuadrature : public Integral
  {
  protected:
    /// Array to hold the weights for each order at each point
    // This is nasty: only the largest list of weights actually has 50 entries
    // but they all have to be the same size.
    typedef double weights_data_structure[4][51][51];

    /// Array to hold co-ordinates for each knot for each order
    typedef double knots_data_structure[4][51][51][1];

    /// Hold the order of Gaussian integration to be used
    unsigned Order;

    /// Hold the dimension of Gaussian integration to be used
    unsigned Dim;

    /// The minimum order used for adaptive quadrature
    unsigned Min_order;

    /// The maximum order used for adaptive quadrature
    unsigned Max_order;

  public:

    /// Default construtor
    VariableQuadrature() : Order(0), Dim(0) {}

    /// Other constructors
    VariableQuadrature(const unsigned &dim) : Order(0), Dim(dim) {}
    VariableQuadrature(const unsigned &dim, const unsigned &order) : Order(order), Dim(dim) {}

    /// Broken copy constructor
    VariableQuadrature(const VariableQuadrature& dummy)
    {BrokenCopy::broken_copy("VariableQuadrature");}

    /// Broken assignment operator
    void operator=(const VariableQuadrature& dummy)
    {BrokenCopy::broken_assign("VariableQuadrature");}

    /// Destructor
    ~VariableQuadrature(){};

    /// Choose the order of Gauss integration to use
    // (we can't choose it via function argument because that breaks compatibility
    // with the already existing integration schemes.)
    void set_order(const unsigned &order)
    {Order = order;}

    /// Get the current order
    unsigned order() const {return Order;}

    /// Choose the dimension of Gauss integration to use
    // (we can't choose it via function argument because that breaks compatibility
    // with the already existing integration schemes.)
    void set_dim(const unsigned &dim)
    {Dim = dim;}

    /// Get the current Dim
    unsigned dim() const {return Dim;}

    /// Return the number of integration points of the order-th Gauss scheme.
    // ??ds generalise for higher dimensions
    unsigned nweight() const
    {return Order;}

    /// Check that dim, order i and j are all within the appropriate ranges.
    void error_check(const unsigned &i, const unsigned &j,
		     const std::string &function_name) const;

    /// Return weight of the i-th integration point.
    virtual double weight(const unsigned &i) const = 0;

    /// Return local coordinate s[j] of i-th integration point.
    virtual double knot(const unsigned &i, const unsigned &j) const = 0;

    /// Set the minimum order used for adaptive quadrature
    void set_min_order(const unsigned &min_order) {Min_order = min_order;}

    /// Set the maximum order used for adaptive quadrature
    void set_max_order(const unsigned &max_order) {Max_order = max_order;}

    /// Get the minimum order used for adaptive quadrature
    unsigned min_order() const {return Min_order;}

    /// Get the maximum order used for adaptive quadrature
    unsigned max_order() const {return Max_order;}
  };

  void VariableQuadrature::error_check(const unsigned &i, const unsigned &j,
				       const std::string &function_name) const
  {
    if((Dim > 3) || (Dim < 1))
      {
	std::ostringstream error_stream;
	error_stream << "Invalid dimension " << Dim;
	throw OomphLibError(error_stream.str(),function_name,
			    OOMPH_EXCEPTION_LOCATION);
      }

    if(Order > 50 )
      {
	std::ostringstream error_stream;
	error_stream << "Gaussian quadrature of order "
		     << Order << " is not (yet) implemented.";
	throw OomphLibError(error_stream.str(),function_name,
			    OOMPH_EXCEPTION_LOCATION);
      }

    if(i >= nweight())
      {
	std::ostringstream error_stream;
	error_stream << Dim << " dimensional Gaussian quadrature of order "
		     << Order << " does not have a weight number " << i
		     << ".";
	throw OomphLibError(error_stream.str(),function_name,
			    OOMPH_EXCEPTION_LOCATION);
      }

    if(j >= Dim)
      {
	std::ostringstream error_stream;
	error_stream << "Dimension of quadrature is " << Dim
		     << " so coordinate " << j << " does not exist";
	throw OomphLibError(error_stream.str(),function_name,
			    OOMPH_EXCEPTION_LOCATION);
      }
  }


  //============================================================
  /// Gauss-Legendre quadrature (the standard Gaussian quadrature used
  /// in oomph-lib).
  //============================================================
  class VariableGaussLegendre : public VariableQuadrature
  {

    /// Holds all the weights for the Gaussian quadrature
    static const weights_data_structure GaussLegendreWeights;

    /// A static data structure holding all the Gaussian quadrature knots
    static const knots_data_structure GaussLegendreKnots;

  public:

    double weight(const unsigned &i) const
    {
#ifdef PARANOID
      unsigned dummy = 0;
      error_check(i,dummy,"VariableGaussLegendre::weight");
#endif
      return GaussLegendreWeights[Dim][Order][i];
    }

    double knot(const unsigned &i, const unsigned &j) const
    {
#ifdef PARANOID
      error_check(i,j,"VariableGaussLegendre::knot");
#endif
      return GaussLegendreKnots[Dim][Order][i][j];
    }
  };

